import Header from './Header'
import Footer from './Footer'

export default function Layout(props) {
    return (
        <div className="layout">
            <div className="header">
                <Header />
            </div>
            <div className="body">
              <body >
                {props.children}
              </body>
            </div>
            <div className="Footer">
                <Footer />
            </div>
            <style jsx>{`
              .header {
                  width: 100%;
                  border: 1px solid;
              }

              .layout {
                margin: 20,
                padding: 20,
                flex: 1,
              }

              .body {
                border: '1px solid #DDD',
                display: 'flex',
                flexdirection: 'column',
                minheight: '100vh',
              }

              .footer {
                width: '100%',
                bottom: 0,
                height: 50,
                background: 'red',
                color: 'white',
                textAlign: 'center',
            }
            
            `}
            </style>
        </div>
    )
}
